static int cali_isp_bnr_np_calc(int ISO_val, ISP_CMOS_NOISE_CALIBRATION_S *np,
	uint16_t dgain, uint16_t wbGain_b, uint16_t wbGain_r,
	int *NpLumaThr, int *NpSlope, int *NpLowOffset);
static int cali_isp_np_float_to_fix_calc(double slope, double intercept,
	int np_luma_thr0, int *np_slope, int *np_low_offset,
	const int nbit_slope1, const int nbit_slope2, const int nbit_low_offset1, const int nbit_low_offset2);

static void BNR_Kernel_API(BNR_KERNEL_S *BnrKernel, int FilterType);
static void BNR_LUT_H_API(CVI_U8 *reg_bnr_weight_lut_h, CVI_U16 BNR_CoarseStr);

static CVI_VOID _swap(CVI_S32 *a, CVI_S32 *b);

CVI_S32 isp_algo_bnr_main(struct bnr_param_in *bnr_param_in, struct bnr_param_out *bnr_param_out)
{
	// ISP_DEBUG(LOG_INFO, "%s\n", "+");
	CVI_S32 ret = CVI_SUCCESS;

	if (bnr_param_in->CoringParamEnable == 0) {
		for (CVI_U32 i = 0 ; i < ISP_BAYER_CHN_NUM ; i++) {
			bnr_param_out->NpLumaThr[i] = 16;
		}
		cali_isp_bnr_np_calc(bnr_param_in->iso, &bnr_param_in->np,
			bnr_param_in->ispdgain, bnr_param_in->wb_bgain, bnr_param_in->wb_rgain,
			bnr_param_out->NpLumaThr, bnr_param_out->NpSlope, bnr_param_out->NpLowOffset);

		// Covert from B->Gb->Gr->R to R->Gr->Gb->B
		_swap(&(bnr_param_out->NpSlope[ISP_BAYER_CHN_R]), &(bnr_param_out->NpSlope[ISP_BAYER_CHN_B]));
		_swap(&(bnr_param_out->NpSlope[ISP_BAYER_CHN_GR]), &(bnr_param_out->NpSlope[ISP_BAYER_CHN_GB]));
		_swap(&(bnr_param_out->NpLowOffset[ISP_BAYER_CHN_R]), &(bnr_param_out->NpLowOffset[ISP_BAYER_CHN_B]));
		_swap(&(bnr_param_out->NpLowOffset[ISP_BAYER_CHN_GR]), &(bnr_param_out->NpLowOffset[ISP_BAYER_CHN_GB]));

	} else {
		for (CVI_U32 i = 0 ; i < ISP_BAYER_CHN_NUM ; i++) {
			bnr_param_out->NpSlope[i] = bnr_param_in->NpSlope[i];
			bnr_param_out->NpLumaThr[i] = bnr_param_in->NpLumaThr[i];
			bnr_param_out->NpLowOffset[i] = bnr_param_in->NpLowOffset[i];
		}
	}

	for (CVI_U32 i = 0 ; i < ISP_BAYER_CHN_NUM ; i++) {
		bnr_param_out->NpHighOffset[i] = bnr_param_in->NpHighOffset[i];
	}

	BNR_Kernel_API(&(bnr_param_out->kernel), bnr_param_in->window_type);
	BNR_LUT_H_API(bnr_param_out->weight_lut, bnr_param_in->filter_type);

	return ret;
}

